import './SwiperExample.css';

import { freeMode } from 'swiper/modules';

import { Swiper, SwiperSlide } from 'swiper/react';

import Image1 from '../Swiper/Image/image1.webp';
import Image2 from '../Swiper/Image/image2.webp';
import Image3 from '../Swiper/Image/image3.webp';

import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/free-mode';

import { Col, Container, Row } from 'react-bootstrap';

function SwiperExample(){
    return(
        <Container fluid>
            <Row>
            <Col xl = "9" md = "9" sm = "12">
                <Swiper
                spaceBetween={10}
                slidesPerView={3}
                navigation
                freeMode = {true}
                grabCursor={true}>
                
                <SwiperSlide>
                    <h1>Slide Item 1</h1>
                </SwiperSlide>

                <SwiperSlide>
                    <h1>Slide Item 2</h1>
                </SwiperSlide>

                <SwiperSlide>
                    <h1>Slide Item 3</h1>
                </SwiperSlide>

                <SwiperSlide>
                    <h1>Slide Item 4</h1>
                </SwiperSlide>

            </Swiper>
            </Col>

            <Col xl = "3" md = "3" sm = "12">
                <img src = {Image1} className = "w-100 h-100"/>
            </Col>
            </Row>
        </Container>
    )
}

export default SwiperExample
